import { FETCH_SONGS_POPULAR } from "./types";
import axios from "axios";

export function fetch_songs_popular() {
  return function(dispatch) {
    axios
      .get("https://jsonplaceholder.typicode.com/todos")
      .then(res =>
        dispatch({
          type: FETCH_SONGS_POPULAR,
          payload: res.data
        })
      )
      .catch(err => console.log(err));
  };
}
